        <meta charset="utf-8">                    
        <script>H5PIntegration = {"ajax":{"setFinished":"","contentUserData":""},"ajaxPath":"undefinedundefined/api/v1/h5p/ajax?action=","contents":{"cid-686fe82a4701f4e76fb9f5e8":{"displayOptions":{"copy":false,"copyright":false,"embed":false,"export":false,"frame":false,"icon":false},"fullScreen":"1","jsonContent":"{\"timeline\":{\"defaultZoomLevel\":\"0\",\"height\":900,\"asset\":{},\"date\":[{\"asset\":{\"media\":\"https://upload.wikimedia.org/wikipedia/commons/thumb/a/ae/Aristotle_Altemps_Inv8575.jpg/500px-Aristotle_Altemps_Inv8575.jpg\",\"credit\":\"By After Lysippos - Jastrow (2006)\",\"caption\":\"Bust of Aristotle. Marble, Roman copy after a Greek bronze original by Lysippos from 330 BC; the alabaster mantle is a modern addition.\"},\"text\":\"<p>Aristotle develops syllogistic logic, laying the groundwork for deductive reasoning and formal systems—a foundation for computation and AI.</p>\\n\",\"headline\":\"Aristotle’s Formal Logic\",\"startDate\":\"-350\"},{\"asset\":{\"media\":\"https://upload.wikimedia.org/wikipedia/commons/2/23/Image-Al-Kit%C4%81b_al-mu%E1%B8%ABta%E1%B9%A3ar_f%C4%AB_%E1%B8%A5is%C4%81b_al-%C4%9Fabr_wa-l-muq%C4%81bala.jpg\",\"caption\":\"A page from al-Khwārizmī&#039;s Algebra\"},\"headline\":\"Al-Khwarizmi and the Birth of Algorithms\",\"text\":\"<p>Persian mathematician Al-Khwarizmi writes \\\"The Compendious Book on Calculation by Completion and Balancing,\\\" introducing algorithmic problem solving—the root of the word “algorithm.”</p>\\n\",\"startDate\":\"830\"},{\"asset\":{\"media\":\"https://upload.wikimedia.org/wikipedia/commons/thumb/0/04/Liber_abbaci_magliab_f124r.jpg/500px-Liber_abbaci_magliab_f124r.jpg\",\"caption\":\"A page of Fibonacci&#039;s Liber Abaci from the Biblioteca Nazionale di Firenze showing (in box on right) the Fibonacci sequence with the position in the sequence labeled with Latin numbers and Roman numerals and the value in Hindu-Arabic numerals\"},\"headline\":\"Fibonacci Introduces Hindu-Arabic Numerals to Europe\",\"text\":\"<p>Leonardo of Pisa (Fibonacci) publishes \\\"Liber Abaci,\\\" helping to spread modern numerals and calculation methods in the West, essential for mathematics and computation.</p>\\n\",\"startDate\":\"1202\"},{\"asset\":{\"media\":\"https://www.youtube.com/watch?v=DiQSHiAYt98\"},\"startDate\":\"1600\",\"headline\":\"The Antikythera\",\"text\":\"<p>In the year 1900, sponge divers discovered the Antikythera Mechanism, a remarkable mechanical computer used to track the cycles of the solar system dated to as early as 89 B.C. There was no input however. All computations were carried out by the intricate system of clockwork like plates and wheels..</p>\"},{\"asset\":{\"media\":\"https://upload.wikimedia.org/wikipedia/commons/thumb/5/5a/Schickardmaschine.jpg/960px-Schickardmaschine.jpg\",\"caption\":\"Replica of Schickards calculating machine\"},\"headline\":\"Wilhelm Schickard Builds the First Mechanical Calculator\",\"startDate\":\"1623\",\"text\":\"<p>Schickard invents the “Calculating Clock,” considered the earliest known mechanical calculator, automating arithmetic operations.</p>\\n\"},{\"asset\":{\"media\":\"https://upload.wikimedia.org/wikipedia/commons/thumb/7/78/Pascaline-CnAM_823-1-IMG_1506-black.jpg/960px-Pascaline-CnAM_823-1-IMG_1506-black.jpg\",\"caption\":\"A Pascaline signed by Pascal in 1652\"},\"headline\":\"Blaise Pascal Invents the Pascaline\",\"text\":\"<p>Blaise Pascal invented this calculator to help his father reorganize the French tax system. It could add and subtract in one step and multiply and divide by repetition.</p>\",\"startDate\":\"1642\"},{\"asset\":{\"media\":\"https://upload.wikimedia.org/wikipedia/commons/thumb/9/92/Leibnitzrechenmaschine.jpg/960px-Leibnitzrechenmaschine.jpg\",\"caption\":\"Stepped reckoner\"},\"headline\":\"Gottfried Wilhelm Leibniz’s Stepped Reckoner\",\"text\":\"<p>Leibniz builds the Stepped Reckoner and lays the foundations for binary arithmetic, both crucial for digital computation.</p>\\n\",\"startDate\":\"1673\"},{\"asset\":{\"media\":\"https://upload.wikimedia.org/wikipedia/commons/5/59/Arithmometre.jpg\",\"caption\":\"Arithmometer built around 1887. At bottom-left is a separate image of the delicate brass lettering (taken from another arithmometer of the same vintage\"},\"startDate\":\"1820\",\"headline\":\"Thomas Arithometer\",\"text\":\"<p>This is the first mass-produced calculator that could add, subtract, multiply and divide. Numbers were input with all of the little knobs and dials and then the handle was twisted to perform the calculation.</p>\"},{\"asset\":{\"media\":\"https://upload.wikimedia.org/wikipedia/commons/thumb/a/a4/Analytical_Engine_%282290032530%29.jpg/500px-Analytical_Engine_%282290032530%29.jpg\",\"caption\":\"Modern model of Charles Babbage&#039;s Analytical Engine displayed at the Science Museum, London.\"},\"startDate\":\"1833\",\"headline\":\"The Analytical Engine\",\"text\":\"<p>Charles Babbage designed but was never able to produce a working model but it is significant in that it relied upon punched cards for data and programs and would employ a language similar to modern assembly language complete with loops and conditional branching (for the nerds out there).</p>\"},{\"asset\":{\"media\":\"https://upload.wikimedia.org/wikipedia/commons/thumb/c/cf/Diagram_for_the_computation_of_Bernoulli_numbers.jpg/960px-Diagram_for_the_computation_of_Bernoulli_numbers.jpg\",\"caption\":\"Lovelace&#039;s diagram from &quot;Note G&quot;, the first published computer algorithm\"},\"headline\":\"Ada Lovelace and the Analytical Engine\",\"text\":\"<p>Ada Lovelace writes notes on Charles Babbage’s Analytical Engine, outlining the first algorithm intended for machine execution—considered the first computer program.</p>\\n\",\"startDate\":\"1843\"},{\"asset\":{\"media\":\"https://upload.wikimedia.org/wikipedia/commons/thumb/7/75/Boole._The_Mathematical_Analysis_of_Logic._Header.png/500px-Boole._The_Mathematical_Analysis_of_Logic._Header.png\",\"caption\":\"George Boole&#039;s &quot;The Mathematical Analysis of Logic&quot;\"},\"headline\":\"George Boole Publishes &quot;The Mathematical Analysis of Logic&quot;\",\"startDate\":\"1847\",\"text\":\"<p>Boole’s work formalizes Boolean algebra, making it possible to represent logical reasoning mathematically—a backbone of computer science.</p>\\n\"},{\"asset\":{\"caption\":\"Gottlob Frege, circa 1879.\",\"media\":\"https://upload.wikimedia.org/wikipedia/commons/9/99/Young_frege.jpg\"},\"headline\":\"Gottlob Frege’s Begriffsschrift\",\"text\":\"<p>Translation by S. Bauer Mengelberg as <em>Concept Notation: A formula language of pure thought, modelled upon that of arithmetic. </em>Frege invents predicate logic, vastly expanding the scope of formal reasoning and symbolic logic, foundational for AI.</p>\\n\",\"startDate\":\"1879\"},{\"asset\":{\"media\":\"https://upload.wikimedia.org/wikipedia/commons/2/27/Russell%2C_Whitehead_-_Principia_Mathematica_to_56.jpg\",\"caption\":\"Principia Mathematica to *56\"},\"startDate\":\"1913\",\"headline\":\"Bertrand Russell and Alfred North Whitehead&#039;s &quot;Principia Mathematica&quot;\",\"text\":\"<p><em>Principia Mathematica</em>, the landmark work in formal logic written by <a target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\" href=\\\"https://plato.stanford.edu/archives/spr2022/entries/whitehead/\\\">Alfred North Whitehead</a> and <a target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\" href=\\\"https://plato.stanford.edu/archives/spr2022/entries/russell/\\\">Bertrand Russell</a>, was first published in three volumes in 1910, 1912 and 1913. A second edition appeared in 1925 (Volume I) and 1927 (Volumes II and III). In 1962 an abbreviated issue (containing only the first 56 chapters) appeared in paperback.</p><p>Written as a defense of <em>logicism</em> (the thesis that mathematics is in some significant sense reducible to logic), the book was instrumental in developing and popularizing modern mathematical logic. It also served as a major impetus for research in the foundations of mathematics throughout the twentieth century. Along with Aristotle’s <em>Organon</em> and Gottlob Frege’s <em>Basic Laws of Arithmetic</em>, it remains one of the most influential books on logic ever written.</p>\"},{\"asset\":{\"media\":\"https://upload.wikimedia.org/wikipedia/commons/4/42/Kurt_g%C3%B6del.jpg\",\"caption\":\"Kurt Friedrich Gödel\"},\"startDate\":\"1931\",\"headline\":\"Kurt Gödel’s Incompleteness Theorems\",\"text\":\"<p>Gödel proves that any sufficiently powerful formal system contains true statements that are unprovable within the system—highlighting limits to computation and logic.</p>\\n\"},{\"asset\":{\"media\":\"https://upload.wikimedia.org/wikipedia/commons/thumb/7/79/Alan_Turing_az_1930-as_%C3%A9vekben.jpg/500px-Alan_Turing_az_1930-as_%C3%A9vekben.jpg\",\"caption\":\"Turing in the 1930s\"},\"headline\":\"Alan Turing’s Universal Machine\",\"text\":\"<p>Turing publishes \\\"On Computable Numbers,\\\" introducing the concept of a universal machine that can simulate any algorithm, laying the foundation for modern computing.</p>\",\"startDate\":\"1936\"},{\"asset\":{\"caption\":\"The McCulloch-Pitts artificial neuron\",\"media\":\"https://upload.wikimedia.org/wikipedia/commons/thumb/6/60/ArtificialNeuronModel_english.png/960px-ArtificialNeuronModel_english.png\"},\"headline\":\"McCulloch & Pitts’ Artificial Neuron Model\",\"text\":\"<p>Warren McCulloch and Walter Pitts propose the first mathematical model of an artificial neuron, showing that neural networks can compute logical functions. It contains inputs, weights, and an activation function.</p>\",\"startDate\":\"1943\"},{\"asset\":{\"media\":\"https://youtu.be/aPweFhhXFvY?si=1QjDfzVoOsjy85zX\",\"caption\":\"Jean Bartik, one of the earliest pioneering women in technology, talks about her memories of breaking into the then new field of computer science and working on the ENIAC in the 1940&#039;s The ENIAC and the story of the women behind it will be part of the upc\",\"credit\":\"Computer History Museum\"},\"startDate\":\"1946\",\"headline\":\"ENIAC\",\"text\":\"<p>Weighing 30 tons, and containing over 18,000 vacuum tubes, the ENIAC was the first truly modern computer. It could be programmed for many complex programs and used an early keyboard as its input. ENIAC was based on the theoretical foundation laid by Alan Turing and developed by John von Neumann, and proved to be the most influential of early computers.</p>\"},{\"asset\":{\"caption\":\"Cybernetics: Or Control and Communication in the Animal and the Machine\",\"media\":\"https://upload.wikimedia.org/wikipedia/commons/thumb/8/8b/Wiki_Loves_Jules_Verne_Norbert_Wiener_Cybernetics_1948_%28Gerd_Kueveler%29.jpg/330px-Wiki_Loves_Jules_Verne_Norbert_Wiener_Cybernetics_1948_%28Gerd_Kueveler%29.jpg\"},\"startDate\":\"1948\",\"headline\":\"Norbert Wiener’s Cybernetics\",\"text\":\"<p>Norbert Wiener’s 1948 book <em>Cybernetics: Or Control and Communication in the Animal and the Machine</em> knit together ideas from electrical engineering, physiology, and mathematics to argue that feedback-driven information loops underlie both living organisms and automatic machines. By treating the brain, servomechanisms, and digital computers as variations of the same signal-processing system, cybernetics supplied early AI with a language of “control,” “communication,” and “negative feedback” that inspired everything from guided missiles to Grey Walter’s autonomous tortoise robots.</p>\"},{\"asset\":{\"media\":\"https://upload.wikimedia.org/wikipedia/en/1/1d/Donald_Hebb.gif\",\"caption\":\"Donald O. Hebb\"},\"startDate\":\"1949\",\"headline\":\"Hebb’s Learning Rule\",\"text\":\"<p>In <em>The Organization of Behavior</em> (1949), Canadian psychologist Donald O. Hebb proposed that persistent, simultaneous activation of two neurons strengthens the connection between them—summarized later as “cells that fire together wire together.” Hebb’s “cell assemblies” offered a biologically plausible way to store patterns, foreshadowing modern concepts such as distributed representation and synaptic weight adjustment in neural networks. His rule became the conceptual backbone for perceptrons, back-propagation, and today’s deep-learning algorithms.</p>\"},{\"asset\":{\"media\":\"https://youtu.be/vuEwLVubGe8?si=ebL45zS7Oziui6Zy\"},\"startDate\":\"1950\",\"endDate\":\"1952\",\"headline\":\"The First Chess Programs\",\"text\":\"<p>Claude E. Shannon’s landmark 1950 paper “Programming a Computer for Playing Chess” sketched two search strategies—Type A (brute-force) and Type B (heuristic, pruning)—and introduced the minimax evaluation that still anchors game-tree search. Around the same time, Alan Turing designed “Turochamp,” the first complete chess algorithm.</p>\"},{\"asset\":{\"caption\":\"Photograph portrait of Alan Turing, taken on 29 March 1951.\",\"media\":\"https://upload.wikimedia.org/wikipedia/commons/thumb/f/f8/Alan_Turing_%281951%29.jpg/500px-Alan_Turing_%281951%29.jpg\"},\"headline\":\"Turing Test\",\"startDate\":\"1950\",\"text\":\"<p>Alan Turing proposes the “imitation game,” now known as the Turing Test, as a criterion for machine intelligence.</p>\\n\"},{\"asset\":{\"media\":\"https://youtu.be/SjQyJLr8TmE?si=j1OLTyV6ZUaRVZmN\"},\"startDate\":\"1951\",\"headline\":\"Stochastic Neural Analog Reinforcement Calculator (SNARC)\",\"text\":\"<p>The Stochastic Neural Analog Reinforcement Calculator (SNARC) is a neural-net machine designed by Marvin Lee Minsky. Inspired by the 1943 Warren McCulloch and Walter Pitts paper on artificial neurons, Marvin Minsky decided to build such a machine. </p>\"},{\"asset\":{\"caption\":\"Herbert Simon (left) in a chess match against Allen Newell c. 1958\",\"media\":\"https://upload.wikimedia.org/wikipedia/commons/f/f7/Herbert_A._Simon_and_Allen_Newell_Chess_Match.jpg\"},\"startDate\":\"1955\",\"headline\":\"Allen Newell & Herbert Simon develop the Logic Theorist concept\",\"text\":\"<p>In 1955, Allen Newell and future Nobel Laureate Herbert A. Simon created the \\\"Logic Theorist\\\", with help from J. C. Shaw. The program would eventually prove 38 of the first 52 theorems in Russell and Whitehead's <em>Principia Mathematica</em>, and find new and more elegant proofs for some. Simon said that they had \\\"solved the venerable mind/body problem, explaining how a system composed of matter can have the properties of mind.\\\" The symbolic reasoning paradigm they introduced would dominate AI research and funding until the middle 90s.</p>\"}],\"language\":\"en\",\"headline\":\"Timeline of Artificial Intelligence\",\"text\":\"<div>Precursors (Pre-1956)</div>\",\"era\":[{\"headline\":\"Classical Logic\",\"startDate\":\"-350\",\"endDate\":\"1600\",\"text\":\"\"},{\"headline\":\"Rationalist Mechanism & Early Calculators\",\"startDate\":\"1600\",\"endDate\":\"1840\",\"text\":\"\"},{\"headline\":\"Symbolic (Mathematical) Logic Takes Shape\",\"startDate\":\"1847\",\"text\":\"\",\"endDate\":\"1930\"},{\"headline\":\"Foundations of Computation & Information\",\"startDate\":\"1930\",\"endDate\":\"1945\",\"text\":\"\"},{\"headline\":\"Cybernetics & First Cognitive Models\",\"startDate\":\"1943\",\"endDate\":\"1950\",\"text\":\"\"},{\"headline\":\"Proto-AI Programs\",\"startDate\":\"1950\",\"endDate\":\"1955\",\"text\":\"\"}],\"backgroundImage\":{\"path\":\"data:image/jpeg;base64,/9j/4AAQSkZJRgABAQEAYABgAAD/4QAC/9sAhAAIBgYHBgUIBwcHCQkICgwUDQwLCwwZEhMPFB0aHx4dGhwcICQuJyAiLCMcHCg3KSwwMTQ0NB8nOT04MjwuMzQyAQkJCQwLDBgNDRgyIRwhMjIyMjIyMjIyMjIyMjIyMjIyMjIyMjIyMjIyMjIyMjIyMjIyMjIyMjIyMjIyMjIyMjL/wgARCAeoDWYDASIAAhEBAxEB/8QANQABAAEFAQEAAAAAAAAAAAAAAAECAwQFBgcIAQEAAwEBAQEAAAAAAAAAAAAAAQIDBAUGB//aAAwDAQACEAMQAAAA8EiTRFVKKRNapiuNLUzMRSqJomoimKxRNRMQKyJRIkJiJASTNVMTciyRdWhcW5TVRVSCZheWq3iuiZpcrzcbLqsU3ptlYjIhGOyIMZVFq0pAIEzMTVWUXabUTkWaK4imKqbAQBeoroi8KpRCkE3U26lqEwWgAAkRITCooiqlAkhIhIhIAAACQkhIhVBCoQJCCQAAABIJAAAJTVTMrIlKISISRCUTCSISQiUISISlCUIShCUWiZrlRXWtnCpERetSZWTi505Y+R0/p/X4eq2trjvU+X
